import {Link}  from 'react-router-dom';
import { useState, useEffect } from 'react';



const Viewfeedback = () =>{
    let[isHidden, setIsHidden] = useState(false);
    let [reviews, updatecategory] = useState([]);


    const getAllReview = () => {
        fetch("http://localhost:1234/productlist")
          .then((response) => response.json())
          .then((reviewarray) => {
            updatecategory(reviewarray.reverse());
          });
      };

      const getfeature = () => {
        fetch("http://localhost:1234/productlist")
          .then((response) => response.json())
          .then((reviewarray) => {
            updatecategory(reviewarray.reverse());
          });
      };

      const getpricing = () => {
        fetch("http://localhost:1234/productlist")
          .then((response) => response.json())
          .then((reviewarray) => {
            updatecategory(reviewarray.reverse());
          });
      };

      const getusability = () => {
        fetch("http://localhost:1234/productlist")
          .then((response) => response.json())
          .then((reviewarray) => {
            updatecategory(reviewarray.reverse());
          });
      };
    
      useEffect(() => {
        getAllReview();
      }, [1]);

      
    return(
    <section>
          <nav className="navbar bg-body-tertiary bg-dark  p-4 h1">
          <div className="container-fluid">
         <span className="navbar-brand mb-0 h1">Feedback Portal</span>
           {/* hide the button onclick */}
          <Link to="/Addfeedback" className="menu"> {isHidden && <button className="btn btn-primary" type="submit" onClick={() => setIsHidden(true)}>Add Feedback</button>} </Link>
      </div>
       </nav>

        <div class="container "> 
             <div className="row mt-5">
                <div className="col-lg-12 text-center fs-1 text-warning menu"> Review </div>
             </div>

            <div className="row "> 
                        <div className="col-lg-12 p-5 text-center">
                           <div className="btn btn-group">
                          <button className="btn btn-primary text-white fs-6 " style = {{ padding: '4px 15px 4px' }} onClick={getAllReview} >All</button> 
                            <button className="btn btn-info text-white fs-6" style = {{ padding: '4px 15px 4px' }} onClick={getfeature}>Features</button> 
                            <button className="btn btn-success text-white fs-6" style = {{ padding: '4px 15px 4px' }} onClick={getpricing}>Pricing</button> 
                           <button className="btn btn-warning text-white fs-6" style = {{ padding: '4px 15px 4px' }} onClick={getusability}>Usability</button> 
                          </div>
                          </div>
             </div>

             return (
    <section>
      <div id="banner"> </div>
     
      <div className="container mt-4">
        <div className="row mb-4">
          <div className="col-lg-4"></div>
          <div className="col-lg-4">
           <input type="text" className="form-control" placeholder="Search..." onChange={obj=> updatekeyword(obj.target.value)}/>
          </div>
          <div className="col-lg-4"></div>
        </div>
        <div className="row">
     {
          allproduct.slice(offset, offset + PER_PAGE).map((product, index) => {

          if(product.name.toLowerCase().includes(keyword.toLowerCase()))
          {
            // it cheks what user type in search box include in the product or not
            return (
              <div className="col-lg-3 mb-4" key={index}>
                <div className="p-3 text-center shadow">
                  <h4 className="text-info mb-3"> {product.name} </h4>
                  <img
                    src={product.photo}
                    className="rounded"
                    height="140"
                    width="100%"
                  />
                  <p className="mt-3"> {product.details} </p>
                  <p className="m-3">Rs. {product.price} </p>
                  <p className="text-center">
                    <button
                      className="btn btn-danger"
                      onClick={addtoCart.bind(this, product)}
                    >
                      <i className="fa fa-shopping-cart"></i>Add to cart
                    </button>
                  </p>
                </div>
              </div>
            );
          }
       })
      }
        </div>
      </div>

     <div className="mb-4 mt-4">
        <ReactPaginate
          previousLabel = {"Previous"}
          nextLabel = {"Next"}
          breakLabel = {"..."}
          pageCount = {pageCount}
          marginPagesDisplayed = {2}
          pageRangeDisplayed={3}
          onPageChange = {handlePageClick}
          containerClassName= {" pagination  justify-content-center " }
          pageClassName= {"page-item"}
          pageLinkClassName= {"page-link"}
          previousClassName= {"page-item"}
          previousLinkClassName = {"page-link"}
          nextClassName = {"page-item"}
          nextLinkClassName= {"page-link"}
          breakClassName= {"page-item"}
          breakLinkClassName = {"page-link"}
          activeClassName= {"active primary"}

          />
     </div>

     <footer className="bg-primary p-5 mt-5 text-white text-center">
      <p>  React Shopping Web Application. Backend With Json Server for API </p>
     </footer>
    </section>
  );
       </div>


</section>
    )
}

export default Viewfeedback;
